void gn(int l, int r, int d = 1) {
	if (l >= r) return;
	ww[d]++;
	gn(l, (l + r) / 2, d + 1);
	gn(1 + (l + r) / 2, r, d + 1);
}
int main(int argc, char* argv[]) {
	/*ios::sync_with_stdio(0);
	cin.tie(0);
	cout.tie(0);*/
	gn(1, 1e5);
	while (1) {
		int l = 1e5;
		string s;
		for (int i = 0; i < l; ++i) s.push_back('0' + (rand() & 1));
		auto r1 = solve1(s);
		auto rr2 = r1;
		rr2[gen() % (rr2.size())] ^= 1;
		auto r2 = solve2(rr2);
		cout << rr2.size() << "\n";
		if (r2 != s) {
			solve2(rr2);
			return -1;
		}
	}
	int t;
	cin >> t;
	if (t == 1) {
		string s; cin >> s;
		cout << solve1(s) << "\n";
	}
	else {
		string s;
		cin >> s;
		cout << solve2(s) << "\n";
	}
}

